import React from 'react';
import Card from './Card';

const CardList = () => {
	const CardListComponent = this.props.robots.forEach(function(i) {
		return <Card id={this.props.robots[i].id} name={this.props.robots[i].name} email={this.props.robots[i].email}/>
	  });
	return (
		<div>
			{ CardListComponent }
		</div>
	);

}

export default CardList;
